--This model shows all queries raised this month. Run this model once as a newly-initialised table, then run it as incremental going forward.
{{
    config(
        materialized='incremental'
    )
}}

SELECT DISTINCT 
*
FROM `bigquery-public-data.stackoverflow.posts_questions` 
where tags NOT like '%comments%'
AND creation_date > '2020-05-01T00:00:00+00:00'
ORDER BY creation_date DESC

--This model shows an index of the Stack Overflow users, ordered by how many badges they've won this year.
{{
    config(
        materialized='table'
    )
}}
 
SELECT DISTINCT 
user_id,
COUNT (name) AS badge_count
FROM `bigquery-public-data.stackoverflow.badges` 
WHERE date > '2020-01-01T00:00:00+00:00'
GROUP BY user_id
ORDER by 2 DESC

--This model splices together contributing user's amount of badges won, with the upvotes they've received.
{{
    config(
        materialized='table'
    )
}}

with badges_index as (

    select * from {{ ref('index_badges_count') }}
),

trending_contributors as (
    select * from {{ ref('index_trending_contributors')}}
),

specialist_area as (
    select last_editor_user_id,
    MAX (max_score)
    FROM {{ ref('index_query_answers')}}
    GROUP BY last_editor_user_id
),
 
joined as (
    SELECT DISTINCT t.id,
    t.active_since_date,
    t.display_name,
    t.up_votes,
    b.badge_count,
    ((t.up_votes + b.badge_count)/2) AS performance_index
    FROM trending_contributors t
    inner join badges_index b 
    on t.id = b.user_id
)

select * from joined
where display_name NOT LIKE '%user%'
ORDER BY 6 DESC
LIMIT 100

